long_desc.thetext:
I'm reassigning this back to qemu as it does indeed appear to be
a race condition in qemu and nothing to do with glib2 (the change
to glib2 appears to have exposed the bug, that's all).

Stefan Hajnoczi diagnosed the problem and came up with the following
patch (to qemu) as a solution:

diff --git a/chardev/char.c b/chardev/char.c
index 3df1163..4d66bb6 100644
--- a/chardev/char.c
+++ b/chardev/char.c
@@ -1059,6 +1059,8 @@ guint qemu_chr_fe_add_watch(CharBackend *be, GIOCondition cond,
     tag = g_source_attach(src, NULL);
     g_source_unref(src);

+    qemu_notify_event();
+
     return tag;
 }
